import './App.css';
import PresignedUrl from "./components/PresignedUrl";
import CheckFileExists from "./components/CheckFileExists";
import DownloadFile from "./components/DownloadFile";
import UploadFile from "./components/UploadFile";

function App() {
  return (
      <div className="App">
        <h1>Amazon S3 File Management</h1>
        <UploadFile/>
        <DownloadFile/>
        <CheckFileExists/>
        <PresignedUrl/>
      </div>
  );
}

export default App;
